      <table className="table">
        <thead>
          <tr>
            <th className="thtd">ID</th>
            <th className="thtd">Даты и время запроса</th>
            <th className="thtd">Nickname</th>
          </tr>
        </thead>

      </table>
      <br />
      <button onClick={() => window.location.href = '/'} className={"button"}>Вернуться к поиску</button>
    </div>
  );
};

